import React from 'react';
import './ExternalUserModal.css';

const ExternalUserModal = ({ open, onContactAdmin }) => {
  if (!open) return null;
  return (
    <div className="external-modal-backdrop">
      <div className="external-modal">
        <h2>บัญชีของคุณยังไม่ได้รับอนุญาต</h2>
        <p>กรุณาติดต่อผู้ดูแลระบบ (admin) เพื่อขอสิทธิ์เข้าใช้งานระบบ</p>
        <button className="contact-admin-btn" onClick={onContactAdmin}>
          ติดต่อแอดมิน
        </button>
      </div>
    </div>
  );
};

export default ExternalUserModal;
